import logo from './logo.svg';
import './App.css';
import Subject from './Components/Subject.js';

function App() {
  return (
    <div className="App">
      <h1>안녕하세요</h1>
      {/* 컴포넌트 사용 */}
      <Subject></Subject>
      <hr/>
      <NAV></NAV>
      <hr/>
      <Content></Content>
    </div>
  );
}

function Content(){
  return (
    <article>
      <h2>HTML</h2>
      HTML은 하이퍼텍스트 마이크업 언어입니다.
    </article>
  );
}

export default App;
